import { gql } from "apollo-boost";

export const CREATE_USER = gql`
  mutation createUsers(
    $userId: String!
    $name: String!
    $username: String!
    $email: String!
    $bio: String!
    $website: String!
    $profileImage: String!
    $phoneNumber: String!
  ) {
    insert_users(
      objects: {
        bio: $bio
        email: $email
        website: $website
        username: $username
        user_id: $userId
        profile_image: $profileImage
        phone_number: $phoneNumber
        name: $name
      }
    ) {
      affected_rows
    }
  }
`;
